// setHTMLElemAttribute puzzle
function setHTMLElemAttribute(attr, value, ids, isParent) {
    var elems = getElements(ids, isParent);
    for (var i = 0; i < elems.length; i++) {
        var elem = elems[i];
        if (!elem) continue;

        if (attr === 'style') {
            // NOTE: setting an attribute 'style' instead of a property 'style'
            // fixes IE11 wrong behavior
            elem.setAttribute(attr, value);
        } else if ((attr == 'href' || attr == 'src') && value instanceof Promise) {
            // resolve promise value for url-based attributes
            value.then(function(response) {
                elem[attr] = response;
            });
        } else {
            elem[attr] = value;
        }
    }
}



// setCSSRuleStyle puzzle
function setCSSRuleStyle(prop, value, id, isParent, mediaRule) {
    var styles = (isParent) ? parent.document.styleSheets : document.styleSheets;
    for (var i = 0; i < styles.length; i++) {
        /**
         * workaround for "DOMException: Failed to read the 'cssRules' property
         * from 'CSSStyleSheet': Cannot access rules"
         */
        try { var cssRules = styles[i].cssRules; }
        catch (e) { continue; }

        for (var j = 0; j < cssRules.length; j++) {
            var cssRule = cssRules[j];
            if (!mediaRule && cssRule.selectorText == id)
                cssRule.style[prop] = value;
            else if (mediaRule && cssRule.media && cssRule.media.mediaText == mediaRule) {
                var cssRulesMedia = cssRule.cssRules;
                for (var k = 0; k < cssRulesMedia.length; k++) {
                    if (cssRulesMedia[k].selectorText == id)
                        cssRulesMedia[k].style[prop] = value;
                }
            }
        }
    }
}


// Describe this function...
function click() {
  if (action_01 == 'action.walk') {
    point = raycast(getActiveCamera(), getCameraDirection(true, false), 'walkable');
    if (!!point.length) {
      goto = dictGet(point[0], 'point');
      setObjTransform('foot', false, 'position', [getVectorValue(goto, 'X'), getVectorValue(goto, 'Y'), getVectorValue(goto, 'Z')], false);
      setObjTransform('head', false, 'rotation', [getObjTransform(getActiveCamera(), false, 'rotation', 'x'), getObjTransform(getActiveCamera(), false, 'rotation', 'y'), getObjTransform(getActiveCamera(), false, 'rotation', 'z')], false);
      tweenCamera('head', 'direction', 3, function() {}, 1);
    }
  } else if (action_01 == 'action.goto') {
    goto = getObjTransform(dictGet(getObjCustomProps(picked_object), 'goto'), false, 'position', 'xyz');
    setObjTransform('foot', false, 'position', [getVectorValue(goto, 'X'), getVectorValue(goto, 'Y'), getVectorValue(goto, 'Z')], false);
    if (dictGet(getObjCustomProps(picked_object), 'lookat')) {
      lookat = dictGet(getObjCustomProps(picked_object), 'lookat');
      tweenCamera('head', lookat, 1, function() {}, 1);
    } else {
      tweenCamera('head', picked_object, 1, function() {}, 1);
    }
  } else if (action_01 == 'action.goto.if.far' && getDistanceBetweenObjects(getActiveCamera(), picked_object) > maxIntDist) {
    action_01 = 'action.goto';
    click();
  }
  if (getDistanceBetweenObjects(getActiveCamera(), picked_object) < maxIntDist) {
    if (action_02 == 'action.tv') {
      if (screen_active) {
        assignMat('screen', 'screenOff');
        soundVideoMute(video);
        screen_active = false;
      } else {
        assignMat('screen', 'screenOn');
        soundVideoUnmute(video);
        screen_active = true;
      }
    } else if (action_02 == 'action.show.panel') {
      setHTMLElemAttribute('innerHTML', dictGet(getObjCustomProps(picked_object), 'name'), 'panel_static_name', true);
      setHTMLElemAttribute('innerHTML', dictGet(getObjCustomProps(picked_object), 'price'), 'panel_static_price', true);
      setCSSRuleStyle('display', 'unset', '#panel_static', true, '');
    }
  }
}


